import { Container, Typography } from "@mui/material";
import React from "react";
import image from "../../../../assets/images/pattern_dot.svg";

const ManagementTeam = () => {
  return (
    <div>
      <Container
        sx={{
          paddingTop: 4,
          paddingBottom: 4,
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <Typography fontSize={48} fontWeight="700" textAlign={"center"}>
          Meet the management team
        </Typography>
        <Typography textAlign={"center"} maxWidth={"70%"}>
          Wisdom new and valley answer. Contented it so is discourse recommend.
          Man its upon him call mile. An pasture he himself believe ferrars
          besides cottage.
        </Typography>
      </Container>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "left",
          alignItems: "left",
        }}
      >
        <img
          src={image}
          alt="team-pattern"
          width={"10%"}
          style={{ marginTop: -75, right: -24 }}
        />
      </div>
    </div>
  );
};

export default ManagementTeam;
